description:
An ambitious young woman (Jessica Simpson) attempting to navigate her way through the cutthroat corporate world becomes the unwitting pawn of two unscrupulous executives seeking to topple and replace the powerful head of an international conglomerate. Penelope Ann Miller, Luke Wilson, Andy Dick, Rachel Leigh Cook, and Jamie Kennedy co-star in director Scott Marshall&amp;#039;s loose remake of the Mike Nichols&amp;#039; 1988 comedy Working Girl

